"use strict";(self.webpackChunkspanish_prototype=self.webpackChunkspanish_prototype||[]).push([[7704],{7704:e=>{e.exports=JSON.parse('{"lessonId":"B1_U61","title":"\u0423\u0440\u043e\u043a 61: Pret\xe9rito perfecto (2)","level":"B1","components":[{"type":"TheoryBlock","title":"\u0422\u0435\u043e\u0440\u0438\u044f: \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u0435 Pret\xe9rito perfecto","content":[{"text":"<strong>1. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f \u0440\u0430\u0437\u0433\u043e\u0432\u043e\u0440\u0430 \u043e \u043f\u0440\u043e\u0448\u043b\u043e\u043c \u043e\u043f\u044b\u0442\u0435, \u043d\u0435 \u0443\u0442\u043e\u0447\u043d\u044f\u044f, \u043a\u043e\u0433\u0434\u0430 \u0438\u043c\u0435\u043d\u043d\u043e \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0438 \u0441\u043e\u0431\u044b\u0442\u0438\u044f. \u0418\u043d\u0444\u043e\u0440\u043c\u0438\u0440\u0443\u0435\u0442 \u043e \u0442\u043e\u043c, \u0447\u0442\u043e \u0431\u044b\u043b\u043e \u0441\u0434\u0435\u043b\u0430\u043d\u043e \u0432 \u0436\u0438\u0437\u043d\u0438 \u0434\u043e \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0433\u043e \u043c\u043e\u043c\u0435\u043d\u0442\u0430.</strong><br><i><strong>He tenido</strong> una vida intensa.<br><strong>He viajado</strong> por todo el mundo.<br><strong>He trabajado</strong> en una f\xe1brica.<br><strong>He sido</strong> actriz...</i>"},{"text":"<strong>- \u0427\u0430\u0441\u0442\u043e \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044e\u0442\u0441\u044f \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u044f `alguna vez`, `nunca`, `hasta ahora`, `en mi vida`...</strong><br><i>\xbf<strong>Hab\xe9is comido</strong> alguna vez sopa de tibur\xf3n?<br>Los padres de Ana no <strong>han salido</strong> nunca de Espa\xf1a.<br>En mi vida <strong>he visto</strong> algo parecido.<br>Hasta ahora no <strong>hemos tenido</strong> ning\xfan problema serio.</i>"},{"text":"<strong>2. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f \u0440\u0430\u0437\u0433\u043e\u0432\u043e\u0440\u0430 \u043e \u043f\u0440\u043e\u0448\u043b\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f\u0445, \u0438\u043c\u0435\u044e\u0449\u0438\u0445 \u043f\u043e\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u0438\u044f \u0432 \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u043c. \u0418\u043d\u0444\u043e\u0440\u043c\u0438\u0440\u0443\u0435\u0442 \u043e \u043f\u0440\u0438\u0447\u0438\u043d\u0430\u0445 \u0442\u0435\u043a\u0443\u0449\u0435\u0439 \u0441\u0438\u0442\u0443\u0430\u0446\u0438\u0438.</strong><br><i>(consecuencia) \u2013Llegas tarde. / (causa) \u2013Lo siento. No <strong>ha sonado</strong> el despertador.<br>(consecuencia) No puedo jugar. / (causa) Me <strong>he roto</strong> una pierna.</i>"},{"text":"<strong>3. \u0418\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f \u0434\u043b\u044f \u0440\u0430\u0437\u0433\u043e\u0432\u043e\u0440\u0430 \u043e \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u0438\u0438 (\u0438\u043b\u0438 \u0435\u0433\u043e \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0438\u0438) \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0434\u043e \u043d\u0430\u0441\u0442\u043e\u044f\u0449\u0435\u0433\u043e \u043c\u043e\u043c\u0435\u043d\u0442\u0430, \u0441 \u0432\u044b\u0440\u0430\u0436\u0435\u043d\u0438\u044f\u043c\u0438 `ya`, `todav\xeda no`, `por fin`...</strong><br><i>Por fin <strong>han acabado</strong> las clases.<br>\u2013La palabra ya indica o pregunta si una acci\xf3n se ha realizado antes de ahora.<br>Ya <strong>he terminado</strong> el cuadro.<br>\xbfHas acabado ya el curso?</i><br><i>\u2013La expresi\xf3n `todav\xeda no` indica o pregunta si una acci\xf3n no se ha realizado antes de ahora.<br>\u2013\xbfTe ha gustado el libro que te prest\xe9? \u2013Todav\xeda no lo <strong>he le\xeddo</strong>.</i>"},{"text":"<strong>4. \u0412\u043e \u043c\u043d\u043e\u0433\u0438\u0445 \u0447\u0430\u0441\u0442\u044f\u0445 \u041b\u0430\u0442\u0438\u043d\u0441\u043a\u043e\u0439 \u0410\u043c\u0435\u0440\u0438\u043a\u0438 \u0438 \u0418\u0441\u043f\u0430\u043d\u0438\u0438 \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f `Pret\xe9rito indefinido` (Com\xed) \u0432\u043c\u0435\u0441\u0442\u043e `Pret\xe9rito perfecto` (He comido).</strong>"}]},{"type":"TheoryBlock","title":"\u041f\u0440\u0438\u043c\u0435\u0447\u0430\u043d\u0438\u0435: \u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 61.1","content":[{"text":"<strong>\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 61.1 \u043f\u0440\u043e\u043f\u0443\u0449\u0435\u043d\u043e, \u0442\u0430\u043a \u043a\u0430\u043a \u043e\u043d\u043e \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u043e \u043d\u0430 \u0430\u043d\u0430\u043b\u0438\u0437\u0435 \u0438\u0437\u043e\u0431\u0440\u0430\u0436\u0435\u043d\u0438\u0439.</strong>"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 61.2: \u041d\u0430\u043f\u0438\u0448\u0438\u0442\u0435 \u0444\u0440\u0430\u0437\u044b \u0441 \u044d\u0442\u0438\u043c\u0438 \u0441\u043b\u043e\u0432\u0430\u043c\u0438","tasks":[{"id":"u61_2_1","sentence":"1. Reinaldo / estar / nunca / en \xc1frica \u2192 ___.","answer":"Reinaldo no ha estado nunca en \xc1frica"},{"id":"u61_2_2","sentence":"2. \xbfustedes / comer / alguna vez / tortilla? \u2192 ___?","answer":"\xbfHan comido ustedes alguna vez tortilla?"},{"id":"u61_2_3","sentence":"3. \xbfvosotros / enamorarse / alguna vez? \u2192 ___?","answer":"\xbfOs hab\xe9is enamorado alguna vez?"},{"id":"u61_2_4","sentence":"4. yo / nunca / ir / a la \xf3pera \u2192 ___.","answer":"Nunca he ido a la \xf3pera"},{"id":"u61_2_5","sentence":"5. nosotros / beber / nunca / tequila \u2192 ___.","answer":"No hemos bebido nunca tequila"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 61.3: \u0421\u043e\u0435\u0434\u0438\u043d\u0438\u0442\u0435 \u044d\u043b\u0435\u043c\u0435\u043d\u0442\u044b \u0434\u0432\u0443\u0445 \u043a\u043e\u043b\u043e\u043d\u043e\u043a","content":[{"text":"<strong>\u041f\u0440\u0438\u0447\u0438\u043d\u044b (Causas):</strong> a. trabajar mucho todo el d\xeda, b. perder las llaves, c. olvidarse la cartera, d. romperse las gafas"}],"tasks":[{"id":"u61_3_1","sentence":"1. No puedo entrar en casa porque ___.","answer":"he perdido las llaves"},{"id":"u61_3_2","sentence":"2. Juana no ve bien porque ___.","answer":"se ha roto las gafas"},{"id":"u61_3_3","sentence":"3. No puedo pagar porque ___.","answer":"me he olvidado la cartera"},{"id":"u61_3_4","sentence":"4. Est\xe1n agotadas porque ___.","answer":"han trabajado mucho todo el d\xeda"}]},{"type":"FillInTheBlank","title":"\u0423\u043f\u0440\u0430\u0436\u043d\u0435\u043d\u0438\u0435 61.4: \u041b\u0430\u0443\u0440\u0430 \u0438 \u0413\u0430\u0431\u0440\u0438\u044d\u043b\u044c \u0435\u0434\u0443\u0442 \u0432 \u043e\u0442\u043f\u0443\u0441\u043a","tasks":[{"id":"u61_4_1","sentence":"1. (recoger los billetes) \u2013\xbf___ los billetes? \u2013S\xed, los ___ ya.","answer":"Has recogido, he recogido"},{"id":"u61_4_2","sentence":"2. (reservar el hotel) \u2013\xbf___? \u2013S\xed, ___.","answer":"Has reservado el hotel, lo he reservado"},{"id":"u61_4_3","sentence":"3. (pedir el visado) \u2013\xbf___? \u2013S\xed, ___.","answer":"Has pedido el visado, lo he pedido"},{"id":"u61_4_4","sentence":"4. (cambiar dinero) \u2013\xbf___? \u2013No, ___.","answer":"Has cambiado dinero, no lo he cambiado"},{"id":"u61_4_5","sentence":"5. (recoger los cheques de viaje) \u2013\xbf___? \u2013No, ___.","answer":"Has recogido los cheques de viaje, no los he recogido"}]}]}')}}]);